import * as tfjs from '@tensorflow/tfjs'
import React from 'react'

let model = null
let link = 'https://drive.google.com/open?id=1XJk68dpwsFKnOU5rCUkr9AYKxjZFlzGK'
model = tfjs.loadLayersModel(link)
const Main = () => {

	if (model == null)
		console.log('model loaded')
	return null
}

export default Main;
